import React, { useState } from 'react'

export const Form = () => {
  const [name,setName]= useState('Sudipta');
  const [color,setColor]=useState('red');
  return (
    <div style={{textAlign:'center',background:'purple',height:'100vh',width:'100vw',display:'flex'}}>
        <h1>Hello {name}</h1>
        <input type="text" width={50}/>
        <button type='submit' onClick={()=>{
          setName('Coder');
          setColor('purple')
        }}onMouseLeave={()=>{
           setName('Sudipta');
           setColor('yellow')
        }}>Click me</button>
    </div>
  )
}
